import React, {useState, useEffect} from 'react'

const Local = (props) => {

	const [totalEnfected, setTotalEnfected] = useState ()
	const [mskEnfected, setMskEnfected] = useState ()

	//BACK END STUFF
	useEffect (() => backEnd(), [props.data])

	const backEnd = () => {
		const data = props.data
		setTotalEnfected (data.infected)
		setMskEnfected (data.infectedByRegion[75].infected)

		console.log (data.infectedByRegion[75].infected)
	}

	return (
		<div>
			{totalEnfected}
		</div>
	)
}

export default Local
